using SIEleccionReina.Control;
using SIEleccionReina.Entidades;
using SIEleccionReina.Properties;
using System.Data;
using System.Drawing;
using System.Text.RegularExpressions;
using System.Windows.Forms;

namespace SIEleccionReinaTests.ControlTests
{
    public class SIEleccionReinaControllerTest
    {
        SIEleccionReinaController controller;
        ClsEstudiante estudiante;

        public SIEleccionReinaControllerTest()
        {
            controller = SIEleccionReinaController.Instance;
            estudiante = new ClsEstudiante( 7, 4, "0123456789", 5, "contra123", 2, "Cesar Armando", "Lopez Perez" );
        }

        [Fact]
        public void EstudianteShouldBeRegistered()
        {
            DataTable estudianteDT = new DataTable( "estudianteDT" );
            estudianteDT.Columns.AddRange( new DataColumn[]
            {
                new DataColumn( "id_estudiante", typeof( int ) ),
                new DataColumn( "id_carrera", typeof( int ) ),
                new DataColumn( "cedula" ),
                new DataColumn( "semestre", typeof( int ) ),
                new DataColumn( "contrasenia" ),
                new DataColumn( "id_rol_usuario", typeof( decimal ) ),
                new DataColumn( "nombres" ),
                new DataColumn( "apellidos" )
            } );

            estudianteDT.Rows.Add( new object[] { 7, 4, "0123456789", 5, "contra123", 2, "Cesar Armando", "Lopez Perez" } );
            controller.RegistrarEstudianteLogueado( estudianteDT );

            Assert.Equivalent( estudiante, controller.EstudianteLogueado );
        }

        [Fact]
        public void EstudianteLogueadoShouldBeClear_LimpiarDatosCierreSesion()
        {
            ClsEstudiante estudiante = new ClsEstudiante( 0, 0, "", 0, "", 0, "", "" );
            controller.LimpiarDatosCierreSesion();

            Assert.Equivalent( estudiante, controller.EstudianteLogueado );
        }

        [Fact]
        public void ButtonShouldBeDisabled() 
        { 
            Button testingButton = new Button();
            testingButton.Enabled = true;
            controller.VotoYaRegistradoButtonPreparer( testingButton );

            Assert.False( testingButton.Enabled );
        }

        [Fact]
        public void ImageShouldBeConvertedToBase64() 
        {
            Regex Base64Regex = new Regex( "^(?:[A-Za-z0-9+/]{4})*(?:[A-Za-z0-9+/]{2}==|[A-Za-z0-9+/]{3}=)?$", RegexOptions.Compiled );            
            string base64Str = controller.ImageToBase64( Resources.Logo_UG_Imagotipo_horizontal_941x206, System.Drawing.Imaging.ImageFormat.Jpeg );

            Assert.Matches( Base64Regex, base64Str );
        }

        [Fact]
        public void Base64ShouldBeConvertedToImage() 
        {
            string base64Str = "";

            Assert.IsAssignableFrom<Image>( controller.Base64ToImage( base64Str ) );
        }
    }
}